.main-container {
    background-color: #fff;
    border-radius: 10px;
    border-width: 1px;
    padding: 0px;
    padding-bottom: 50px;
    margin-bottom: 100px;
    min-height: 70%;
    h3,
    h4 {
      display: inline;
      font-size: 18px;
    }

    .bm-header {
      border-bottom: 1px solid #f2f2f2;
    }

    .bm-header-col {
      padding-right: 20px;
      padding-left: 13px;
    }

    .row-margin-top {
      margin-top: 50px;
    }

    .row-table {
      // overflow-x: scroll;
      padding: 0 !important;
    }

    .row-padding {
      padding-left: 3.2%;
      padding-right: 3%;
      padding-top: 15px;
      padding-bottom: 5px;
      margin-right: 0px;
      margin-left: 0px;
    }

    .col-centered {
      padding-left: 0px;
      padding-right: 0px;
      text-align: center;
    }
    /* 
    .btn {
      padding-left: 5%;
      padding-right: 5%;
      margin-left: 20px;
    }
   */

    .btn-small {
      font-size: 13px;
      padding-left: 10px;
      padding-right: 10px;
    }

    .pull-right {
      float: right;
      min-width: 85px;
      line-height: 15px;
    }

    .btn-ordinary {
      background-color: #556486;
      color: #fff;
      text-align: center;
    }
  }

  //FROM BEFORE CCSS >>>>>

  .billingModel {
    color: #556486;
    // background: linear-gradient(0deg, #959FAF, #959FAF);
    background-blend-mode: color, normal;
  }

  .billingImg {
    background: #fcfdff;
  }

  .medium-font-size {
    font-size: 14px;
  }

  tr:hover {
    background-color: #dfe8fb;
    cursor: pointer;
    font-weight: 600;
  }

  td {
    font-weight: none !important;
  }

  .info-mark {
    cursor: pointer;
  }

  .col-md-2.FloatLeft .separate-arrow-wrapper {
    width: 100%;
    text-align: center;
  }

  .billingImg {
    height: 135px !important;
  }

  @media only screen and (min-width: 1920px) {
    .productHeading span {
      padding-left: 70px;
    }
    .balance-container-white {
      left: 55% !important;
    }
    .info-message:hover .balance-container-white {
      line-height: 1.3;
      padding-top: 7px;
    }
  }

  .products {
    margin: 0px;
    font-style: normal;
    font-weight: normal;
    line-height: 29px;
    font-size: 18px;
    text-align: center;

    color: #000000;
  }

  button {
    cursor: pointer;
  }

  .wholeDiv {
    min-height: 565px;
    background-color: #ffffff;
  }

  .thead {
    background: #ffffff;
  }

  table {
    border-bottom: 1px solid #e3ebf3;
  }

  .table td {
    padding: 1rem;
  }

  .trHeader:hover {
    background: none !important;
  }

  @media only screen and (max-width: 768px) {
    .main-container {
      .row-table {
        margin-right: 10px;
        margin-left: 10px;
      }
    }
  }

  ////////////// table css //////////////
  table {
    width: 100%;
  }

  td,
  th {
    border: #e2e3e6;
  }

  .test-indicator {
    width: 90%;
    height: 60%;
    text-align: right;
    background-color: #ffefe9;
    color: #f97841;
    text-align: center;
    font-size: 13px;
    float: right;
    margin-top: 8px;
    padding-top: 3px;
    padding-bottom: 3px;
    padding-left: 30px;
    padding-right: 30px;
    border-radius: 3px;
  }

  .active-product,
  .testing-product,
  .inactive-product,
  .expired-product {
    font-size: 8px;
  }

  .side-options-position {
    position: relative;
  }

  // .column {
  //   background: #ffffff;
  //   border: 0.5px solid #f4f6fb;
  //   box-sizing: border-box;
  // }

  .ropstenNetworkOn-cell {
    padding-right: 25px;
  }

  .columnClicked-cell {
    text-align: right;
    margin-left: 50px;
  }

  .columnClicked {
    width: 40px;
    text-align: right;
  }

  .mat-sort-header-button,
  .mat-row.ng-star-inserted {
    margin: 0 auto;
    text-align: center;
  }

  .mat-column-productName > .mat-sort-header-container {
    text-align: center;
  }

  /////options button///////////
  .dropdown-toggle::after {
    display: none;
  }

  .dropdown-item-action {
    float: left;
    text-align: left;
    margin-top: 7px;
    margin-right: 5px;
    padding-left: 5px;
  }

  .action-button-label {
    font-family: "Lato", sans-serif;
    font-weight: 600;
    padding-top: 6px;
    margin-right: 30px;
    //padding-right: 25px;
  }

  .dropdown-item {
    color: #556486;
    vertical-align: middle;
  }

  .options-menu {
    border: 1px solid #ffffff;
    position: absolute;
    background-color: #ffffff;
    box-sizing: border-box;
    z-index: 99;
    right: -16px;
    box-shadow: 0px 2px 25px rgba(85, 100, 134, 0.1);
    //padding-right: 30px;
  }

  .dropdown-item:hover {
    color: #2d6ced !important;
    background-color: #e0eaff !important;
  }

  .arrow-up {
    border-bottom: 10px solid #ffffff;
    border-left: 10px solid transparent;
    border-right: 10px solid transparent;
    position: absolute;
    top: -10px;
    right: 13px;
  }

  ///////tooltip//////////
  .tooltip-icon {
    margin-left: 5px;
    color: #bdbdbd;
  }

  .mat-column-productName {
    text-align: center;
    font-size: 13px;
  }

  table th td {
    text-align: center;
    vertical-align: middle;
  }

  ::ng-deep .product-table .mat-header-cell .mat-sort-header-container {
    justify-content: center;
    padding: 16px;
  }

  // ::ng-deep .product-table .cdk-column-productName .mat-sort-header-container {
  //   justify-content: flex-start;
  // }

  // ::ng-deep .product-table .cdk-column-totalEarnings .mat-sort-header-container,
  // ::ng-deep .product-table .cdk-column-creationTimestamp .mat-sort-header-container {
  //   justify-content: flex-end;
  // }

  ::ng-deep .product-table .mat-cell {
    padding: 0 12px 0 0;
  }

  ::ng-deep .new-product .tooltip-btn + .tooltip {
    left: auto !important;
    padding-bottom: 10px;
    right: 95px;
    top: 175px !important;
  }

  ::ng-deep .new-bm .tooltip-btn + .tooltip {
    left: auto !important;
    padding-bottom: 10px;
    right: 75px;
    top: 175px !important;
  }

  ::ng-deep .tooltip-btn + .tooltip {
    left: auto !important;
    right: 10px;
    padding-bottom: 20px;
  }

  ::ng-deep .tooltip-btn + .tooltip .arrow {
    left: auto !important;
    right: 20px;
    bottom: 4px;
  }

  ::ng-deep .tooltip-btn + .tooltip .tooltip-inner {
    width: 275px;
    max-width: inherit;
    font-size: 12px;
    line-height: 16px;
    padding: 8px 14px;
    text-align: left;
  }

  ::ng-deep .tooltip-relative {
    position: relative;
    display: inline-block;
  }

  ::ng-deep .tooltip-relative .tooltip-btn + .tooltip {
    right: 0px !important;
    top: auto !important;
    left: auto !important;
    bottom: 100%;
    padding-bottom: 10px;
  }

  .btn-inline {
    display: inline-block;
    white-space: nowrap;
    margin-left: 0 !important;
  }

  table thead th {
    border-bottom: 1px solid #e3ebf3;
  }

